import "./MusicPage.css";

const MusicPage = () => {

  const Spotify = () => {
    var element = document.getElementById('playlist1');
    element.innerHtml = '<iframe style="border-radius:12px" src="https://open.spotify.com/embed/playlist/2n5JJJkFQMlmdYOsopsd8n?utm_source=generator&theme=0" width="100%" height="380" frameBorder="0" allowfullscreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture" loading="lazy"></iframe>';
  }
    return (
        <>
          {(
            
             
                <div id="space">
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="welcome"> WELCOME TO MY MUSIC PORTAL </div>
                    <div className="title"> MUSIC MOODZ </div>
                    <div className="caption">Choose a mood from the cards below for the perfect playlist</div> 
                    {/* <ReactPlayer url = "https://open.spotify.com/playlist/2n5JJJkFQMlmdYOsopsd8n?si=d9494a42af77457c"> */}
                    {/* <a style={{border:"12px", allow:"picture-in-picture"}} href="https://open.spotify.com/embed/playlist/2n5JJJkFQMlmdYOsopsd8n?utm_source=generator&theme=0" target="_blank" rel="noreferrer">
                    
                      <button type="button" className="box"> BEGIN</button>
                    
                   
                    </a> */}

                  <iframe title="playlist" style={{border:"12px"}} src="https://open.spotify.com/embed/playlist/2n5JJJkFQMlmdYOsopsd8n?utm_source=generator&theme=0" width="50%" height="380" frameBorder="0" allowFullscreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture" loading="lazy">
                    
                  </iframe>
                     
                </div>
                
              
            
          )}
        </>
    )
}

export default MusicPage
